<script>
    document.addEventListener("DOMContentLoaded", function() {
 
    const captchaContainer = document.getElementById('captchaContainer');
    const captchaInput = document.getElementById('captchaInput');
    const consultaCitaForm = document.getElementById('consultaCitaForm');

    // Generar una cadena aleatoria de 3 a 6 letras
    function generateCaptcha() {
        const chars = 'abcdefghijklmnopqrstuvwxyz';
        const length = Math.floor(Math.random() * 4) + 3; // Longitud entre 3 y 6
        let captcha = '';
        for (let i = 0; i < length; i++) {
            captcha += chars.charAt(Math.floor(Math.random() * chars.length));
        }
        return captcha;
    }

    // Aplicar estilos y generar el captcha
    function createCaptcha() {
        const captcha = generateCaptcha();
        captchaContainer.textContent = captcha;
        captchaContainer.style.backgroundColor = `rgb(${Math.random()*255}, ${Math.random()*255}, ${Math.random()*255})`;
    }

    // Inicializar captcha al cargar la página
    createCaptcha();

    // Validar captcha al enviar el formulario
    consultaCitaForm.addEventListener('submit', function(event) {
        if (captchaInput.value !== captchaContainer.textContent) {
            event.preventDefault();
            alert('Captcha incorrecto. Por favor, intente de nuevo.');
            //createCaptcha();
            var modalElement = document.getElementById('resultadoModal');
        modalElement.style.display = 'none';

           
        }else{
                        $('#consultarCitaModal').modal('hide');
                        $('#resultadoModal').modal('show');
        }
    });
});

</script>                       </h6>
