                    <script>
        $(document).ready(function() {
            $('#consultaCitaForm').on('submit', function(e) {
                e.preventDefault();

                var idcita = $('#idcita').val();
                var fecha = $('#fecha').val();
                var identificaion = $('#identificaion').val();
                var refece = $('#refece').val();
                var contra = $('#contra').val();

                $.ajax({
                    url: 'ver.php',
                    type: 'POST',
                    data: { idcita: idcita, fecha: fecha ,identificaion,refece,contra},
                    success: function(response) {
                        $('#resultadoModalBody').html(response);

                    },
                    error: function() {
                        alert('Error en la consulta. Por favor, intenta de nuevo.');
                    }
                });
            });
        });
    </script>
